import { dataActions } from "./data";

export const fetchImages = () => {
  return (dispatch) => {
    const response = fetch("http://localhost:8000/api/v1/getImages")
      .then((data) => data.json())
      .then((data) => {
        console.log(data.data);
        return data.data;
      });

    dispatch(dataActions.replaceImages(response));
  };
};
